TITLE:
  - Pseudo-1D fluid pusher problem with a weakly compressible
  - isothermal flow of a Newtonian fluid with pressure-dependent
  - density according to Murnaghan-Tait law.
ALE DYNAMIC:
  ALE_TYPE: springs_spatial
  LINEAR_SOLVER: 1
FLUID DYNAMIC:
  PHYSICAL_TYPE: "Weakly_compressible"
  LINEAR_SOLVER: 1
  TIMEINTEGR: "Np_Gen_Alpha"
  ITEMAX: 100
  ALPHA_M: 0.5
  ALPHA_F: 0.5
  GAMMA: 0.5
FLUID DYNAMIC/NONLINEAR SOLVER TOLERANCES:
  TOL_VEL_RES: 1e-10
  TOL_VEL_INC: 1e-10
  TOL_PRES_RES: 1e-10
  TOL_PRES_INC: 1e-10
FLUID DYNAMIC/RESIDUAL-BASED STABILIZATION:
  SUPG: false
  GRAD_DIV: false
FSI DYNAMIC:
  MATCHGRID_FLUIDALE: false
  MATCHGRID_STRUCTALE: false
  MAXTIME: 0.5
  NUMSTEP: 40
  RESTARTEVERY: 2
  SECONDORDER: true
  TIMESTEP: 0.0125
FSI DYNAMIC/PARTITIONED SOLVER:
  CONVTOL: 1e-07
  PARTITIONED: "DirichletNeumannVolCoupl"
  PREDICTOR: "d(n)+dt*v(n)+0.5*dt^2*a(n)"
  RELAX: 0.825
MORTAR COUPLING/PARALLEL REDISTRIBUTION:
  GHOSTING_STRATEGY: "redundant_all"
VOLMORTAR COUPLING:
  INTTYPE: "Segments"
  COUPLINGTYPE: "consint"
  CUTTYPE: "Tessellation"
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  PREDICT: "ConstDisVelAcc"
  LINEAR_SOLVER: 1
SOLVER 1:
  SOLVER: "UMFPACK"
MATERIALS:
  - MAT: 1
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 2e+06
      NUE: 0.3
      DENS: 0.00078
  - MAT: 2
    MAT_fluid_murnaghantait:
      DYNVISCOSITY: 1
      REFDENSITY: 1
      REFPRESSURE: 0
      REFBULKMODULUS: 100
      MATPARAMETER: 1
      GAMMA: 1
  - MAT: 3
